      <div className="container-23">
      <h1 id='hed-23'>Education Form</h1>
      {/* <p>Please fill in this form</p> */}
        <div></div>
      
      
              {/* tablediplay */}
      <div className="App">
      {loading ? (
        <div>Loading...</div>
      ) : (
        <><>
          <h1 id='tabhed'>DataTable</h1>
          <table style={{ borderCollapse: 'collapse', width: '100%' }} className='tab1'>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>password</th>
              <th>Date</th>
              <th>gender</th>
              <th>address</th>
              <th>Phone</th>
              <th>qualification</th>
              <th>stream</th>
              <th>yearofpass</th>
              
            </tr>
            {users.map(user => (
              <tr key={user.id}>
                <td>{user.name}</td>
                <td>{user.email}</td>
                <td>{user.password}</td>
                <td>{user.dateofbirth}</td>
                <td>{user.gender}</td>
                <td>{user.mobilenumber}</td>
                <td>{user.qualification}</td>
                <td>{user.stream}</td>
                <td>{user.yearofpass}</td>
              </tr>
            ))}
          </table>
        </></>
      )}
    </div>
      </div>
    
    
  );
}

export default RegistrationForm;
